// import logo from './logo.svg';
// import './App.css';

import React, {Component} from 'react';
import ReactDOM from 'react-dom';

import FilteredList from './FilteredList'

const songs_list = [
  {name: "Cardigan", year: "2020", album: "Folklore", length: "3.59"},
  {name: "Mine", year: "2010", album: "Speak Now", length: "3.52"},
  {name: "The Last Great American Dynasty", year: "2020", album: "Folklore", length: "3.51"},
  {name: "All Too Well", year: "2012", album: "Red", length: "5.28"},
  {name: "Cruel Summer", year: "2019", album: "Lover", length: "2.58"},
  {name: "Style", year: "2015", album: "1989", length: "3.51"},
  {name: "Lover", year: "2019", album: "Lover", length: "3.41"},
  {name: "Delicate", year: "2018", album: "Lover", length: "3.52"},
  {name: "The 1", year: "2020", album: "Folklore", length: "3.30"},
  {name: "Clean", year: "2015", album: "1989", length: "4.31"},
  {name: "Teardrops On My Guitar", year: "2007", album: "Taylor Swift", length: "3.35"},
  {name: "Our Song", year: "2007", album: "Taylor Swift", length: "3.24"},
]

class App extends Component {
// function App() {
  render() {
    return (
      <div>
        <FilteredList list={songs_list} />

      </div>
    )
  }

}

ReactDOM.render(<App />, document.getElementById("root"))
